ro for S02, no voice. Has now been deleted and replaced by X01','inactive',NULL),('2014-04-06 16:32:42','2014-04-06 16:32:42',46,'S02c','','- 3F Nomer, Then reversed',NULL,'Active',NULL),('2014-04-06 16:32:42','2014-04-06 16:32:42',47,'S02d','','D- 5F Nomer',NULL,'Inactive',NULL),('2014-04-06 16:32:42','2014-04-06 16:32:42',48,'S03','','Czech Words',NULL,'Inactive',NULL),('2014-04-06 16:32:43','2014-04-06 16:32:43',49,'S04','','Edna Sednitzer','both male and female voices used','Inactive','Slovakia'),('2014-04-06 16:32:43','2014-04-06 16:32:43',50,'S05','','OLZ ','This is an early format null messages','Inactive',NULL),('2014-04-06 16:32:43','2014-04-06 16:32:43',51,'S05a','','OLX','same as S05 but with a different format','Inactive',NULL),('2014-04-06 16:32:43','2014-04-06 16:32:43',52,'S05b','','OLX','Same as S05 but with different format','Inactive',NULL),('2014-04-06 16:32:43','2014-04-06 16:32:43',53,'S06','','Russian Man','A very active Russian nuberstation that Transmits using USB with a carrier(H3E)','Active','Russia'),('2014-04-06 16:32:43','2014-04-06 16:32:44',54,'S06a','','Russian Man','A varient of S06 with a- 55555 00000 format)','Active','Russia'),('2014-04-06 16:32:44','2014-04-06 16:32:44',55,'S06b','','Russian Man','Another varient of S06 with the format 11111 11111 before the message','Active','Russia'),('2014-04-06 16:32:44','2014-04-06 16:32:44',56,'S06c','','Russian Man','Another varient of S06 with a single 5F group repeated. ','Active','Russia'),('2014-04-06 16:32:44','2014-04-06 16:32:44',57,'S06d','','Russian Man','varient of s06 with ID+111','Active','Russia'),('2014-04-06 16:32:44','2014-04-06 16:32:44',58,'S06e','','Russian Man','A varient of S06 but with 2 messages','Active','Russia'),('2014-04-06 16:32:44','2014-04-06 16:32:44',59,'S06f','','Russian Man','a S06 varient with a call up of 00000-00000','Active','Russia'),('2014-04-06 16:32:44','2014-04-06 16:32:44',60,'S06s','','Russian lady',NULL,'Active','Russia'),('2014-04-06 16:32:44'